import SoundingImages from "./SoundingImages"; // Import the new component
import Quadcopter from "./Quadcopter"; // Import the new component

export default function Performances() {
    return (
        <div className="p-4 text-black bg-white bg-opacity-35">
            <SoundingImages 
                containerClass="grid grid-cols-3 gap-8 mt-8"
                textClass="col-span-1 text-gray-800"
                iframeWrapperClass="col-span-2 w-full"
                iframeClass="border-4 border-gray-300 shadow-lg"
            />
            <Quadcopter 
                containerClass="grid grid-cols-3 gap-8 mt-8"
                textClass="col-span-1 text-gray-800"
                iframeWrapperClass="col-span-2 w-full"
                iframeClass="border-4 border-gray-300 shadow-lg"
            />
        </div>
    );
}

